import React from 'react';
// import logo from '../assets/Fin-map-2.png';
// import './App.css';
import SignUp from '../pages/Register/SignupPage/signUp';
import LogIn from '../pages/Register/LoginPage/logIn';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import HomePage from '../pages/Home/homepage';
// import Dashboard from '../pages/Dashboard/Dashboard';
// import AboutUs from '../pages/AboutUs/AboutUs';
// import Home from '../pages/Home/Home';
import NoPage from '../pages/Error/NoPage';

function App() {
  return (
    <BrowserRouter>
      {/* <div className="App"> */}
        {/* <div className='image-container'>
          <img src={logo} alt="logo" id='overlay' />
        </div> */}
        {/* <div className='Routes'>
          <a href='./SignUp' className='btn'>Sign Up</a>
          <a href='./logIn' className='btn'>Log In</a>
          <a href='./Dashboard' className='btn btn-3'>Dashboard</a>
          <a href='./AboutUs' className='btn'>About Us</a>
        </div> */}
        <Routes>
          <Route path='/' element={<HomePage />} />
          <Route path='/home' element={<HomePage />} />
          <Route path='/signup' element={<SignUp />} />
          <Route path='/login' element={<LogIn />} />
          {/* <Route path='/dashboard' element={<Dashboard />} /> */}
          {/* <Route path='/aboutus' element={<AboutUs />} /> */}
          <Route path='*' element={<NoPage />} />
        </Routes>
      {/* </div> */}
    </BrowserRouter>
  );
}

export default App;
